        dataIndex: 'price'
    },
    {
        title: 'Remove',
        key: 'remove',
        dataIndex: 'ticketId',
        render: (text, data) => (
            <div style={{width: '100%', display: 'flex', justifyContent: 'center', alignItems: 'center'}}>
                <GenButton icon={<CloseOutlined />} onClick={() => {
                        console.log('ticketId: ' + data.ticketId)
                    }}/>
            </div>
          )
    }
];

const DATA: Ticket[] = [
    {
        game: MichiganFootballGame.Ball,
        price: 25,
        id: '12345',
        section: 24
